// src/components/Projects.js
import React from 'react';
import ProjectCard from './ProjectCard';
import './Project.css';

const Projects = () => {
  return (
    <div>
      <h1>My Projects</h1>
      <ProjectCard 
        title="Library Management System"
        description="A system designed to manage library functions like cataloging and circulation."
        technologies={['Spring Boot', 'REST API', 'HTML', 'CSS', 'React', 'MySQL']}
        link="https://github.com/yourusername/library-management-system" // Replace with your actual link
      />
      <ProjectCard 
        title="Logistic REST API"
        description="API for real-time tracking of logistic activities."
        technologies={['Spring Boot', 'REST API', 'PostgreSQL']}
        link="https://github.com/yourusername/logistic-rest-api" // Replace with your actual link
      />
    </div>
  );
};

export default Projects;
